import React, { useEffect, useState } from 'react';
import api from '../api/api';

const ResultsPage = () => {
  const [results, setResults] = useState([]);

  useEffect(() => {
    const fetchResults = async () => {
      try {
        const res = await api.get('/api/votes/results'); // ✅ Correct endpoint
        console.log('Election results:', res.data.results); // Debug
        setResults(res.data.results);
      } catch (err) {
        console.error('Failed to load results:', err);
        alert('Failed to load results.');
      }
    };

    fetchResults();
  }, []);

  return (
    <div className="p-6 max-w-3xl mx-auto">
      <h2 className="text-2xl font-bold mb-4">Election Results</h2>
      <table className="w-full border-collapse">
        <thead>
          <tr className="text-left border-b">
            <th className="py-2">Candidate</th>
            <th className="py-2">Party</th>
            <th className="py-2">Votes</th>
          </tr>
        </thead>
        <tbody>
          {results.map((candidate) => (
            <tr key={candidate.candidateId} className="border-b">
              <td className="py-2">{candidate.name}</td>
              <td className="py-2">{candidate.party}</td>
              <td className="py-2">{candidate.voteCount ?? 0}</td> {/* Show 0 if undefined */}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ResultsPage;
